import './Stylecontact.css';
import img from './ewallet.png'
const Contactus = () => {
    return(
        <>
        <div><h1>Contact us </h1></div>
        <div className="row">
           
        <div class="grid text-center">
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
</div>
        </div>
       
        </>
    )
 
}

  
export default Contactus;
